import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";



// ------------------------------- components --------------------------------------

import Header from "./components/Header";
import Home from "./components/Home";





// ------------------------------- stylesheets --------------------------------------

import "./styles/ha"


function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path={"/home"} element={<Home />} />
      </Routes>
    </Router>
  );
}

export default App;
